import React from 'react';
import { Link, BrowserRouter } from 'react-router-dom';
import Routes from '../../routes/Routes'

const Nav = () => {
  return (
    <div className="nav__container">
      <BrowserRouter>
        <Link to="/builder"> Builder </Link>
        <Link to="/"> Home </Link>
        <Link to="/shipList"> Launchpad </Link>
        <Routes />
      </BrowserRouter>
    </div>
  );
};

export default Nav;
